import React from "react";
import Loading from "./Loading";
import Project from "./Project";
import Player from "./Player/Player";
import NotFound from "./NotFound";
import { useAudioset } from "./useAudioset";
import { RouteComponentProps } from "react-router";
import { match } from "react-router-dom";
import { AudiosetProject } from "../lib/audioset";

type AppParams = { id: string };

type LoadAudiosetProps = {
  match: match<AppParams>;
};

const LoadAudioset = ({ match }: LoadAudiosetProps) => {
  const id = match.params.id || "index";
  const audioset = useAudioset(id);

  switch (audioset.type) {
    case "loading":
      return <Loading />;
    case "project":
      return <Project audioset={audioset as AudiosetProject} />;
    case "audioset":
      return <Player audioset={audioset} />;
    case "error":
      return <NotFound />;
    default:
      return (
        <pre style={{ color: "white" }}>
          {JSON.stringify(audioset, null, 2)}
        </pre>
      );
  }
};

export default LoadAudioset;
